  return (
    <div>
      <div>
        testSpider
      </div>
      <div className='Card--button'>
        <button
          onClick={() => testSpider()}
          className='Card--button__delete'
        >
          testSpider
        </button>
      </div>
      <div>
        {spiders && spiders.length ? spiders.slice(0,10).map(item=>{
         return <h5>{item.title}</h5>
        }): null}
      </div>
    </div>
  )
}

export default Spider
